import {useState} from 'react'
import Counter from './counter';
function App () {
const [count,setCount] =useState(0)

    
    const addCount=()=>{
setCount(count+1)

    }   
    let obj = {
      title:'1st Counter',
      count
    }                                                   
  return(
    <div className='App'>
       
    <button onClick={addCount} >Add</button>
    <Counter {...obj} />
    <Counter title='2ns counter' count={count} />

   
     </div>
  );
}
export default App;
